import React, {
    Component
} from 'react'
import { Header } from 'grommet';

const theme = {
  global: {
    font: {
      family: 'Roboto',
      size: '18px',
      height: '20px',
    },
  },
};

export class Name extends Component {
    render() {
        return (
            <Header theme={theme}>
                <h1>SALUT LES LOOSERS</h1>
            </Header>
        )
    }
}

export default Name
